import React from 'react';

const FormSearch = () => {
    return (
        <div className={cx('header_row d-flex align-items-center justify-content-between')}>
            <div className={cx('search_btn')} onClick={()=>setSearchTonggle(true)}>
                <i className={cx('fa-solid fa-magnifying-glass icon')}></i>
            </div>
            <div className="search_input">
                <input type="text" placeholder='Tìm kiến sản phẩm ...'/>
            </div>
            <div className={cx('cart_btn')}>
                <i class="fa-solid fa-xmark"></i>
            </div>
        </div>
    );
}

export default FormSearch;
